INSERT INTO `mkcms_category` VALUES (20,'关于我们','ABOUT US',1,0,37,'/uploads/image/20170929/9c945b7db7641940eeb9ac0f9e9b303a.jpg','','','','','','list_page.html','',1,1,1,1,'<p>1创立于2000年， 经过多年的不懈努力，公司现已经成为一家专业从事IT产品开发、生产和销售的高科技企业。公司成立几年来，一直致力于工控/服务器机箱及各种非标箱体的开发与生产，产品现广泛应用于计算机网络、监控、安防、广电、通讯和仪器设备等多种行业</p>','<p>深圳市**科技有限公司位于美百度丽富饶的中国广东省深圳市松岗溪头工业区，主要从事精密模具开发及制造，专业冲压精密五金电子电器零配件等.产品已通过ISO--9001：2000国际标准品质体系认证，以满足各种客户的多层次需求，全体职员本着“以人为本，以质取胜，持续改进，永续经营”的企业生产理念，产品直销日本，美国，欧洲及东南亚其它国家。我们承诺：为客户提供价格合理，质量优良的产品及服务，以期提高市场的竞争力，成为你最值得信赖的供应商。主要产品：机箱，机蕊，汽车音箱，传真机，打印机，复印机，手机，摄像头,',1),(21,'产品展示','',1,0,34,'','','','','','','list_product.html','show_product.html',2,1,0,1,'<p>某某有限公司位于美丽富饶的中国广东省深圳市松岗溪头工业区，主要从事精密模具开发及制造，专业冲压精密五金电子电器零配件等.产品已通过ISO--9001：2000国际标准品质体系认证，以满足各种客户的多层次需求，全体职员本着“以人为本，以质取胜，持续改进，永续经营”的企业生产理念，产品直销日本，美国，欧洲及东南亚其它国家。我们承诺：为客户提供价格合理，质量优良的产品及服务，以期提高市场的竞争力，成为你最值得信赖的供应商。主要产品：机箱，机蕊，汽车音箱，传真机，打印机，复印机，手机，摄像头,外壳及配件，各','',1),(22,'建筑装饰五金','',1,21,40,'','','','','','','list_product_diy.html','show_product.html',1,1,0,0,'<p>建筑五金建筑物或构筑物中装用的金属和非金属制品、配件的总称。一般具有实用和装饰双重效果。</p>','',0),(24,'手动工具','',1,21,34,'','','','','','','list_product.html','show_product.html',3,1,0,0,'','',0),(27,'其他五金','',1,21,34,'','','','','','','list_product.html','show_product.html',6,1,0,0,'','',0),(35,'建筑五金','',1,22,40,'','','','','','','list_product_diy.html','show_product.html',0,1,0,0,'<p>建筑五金建筑物或构筑物中装用的金属和非金属制品、配件的总称。一般具有实用和装饰双重效果。</p>','',0),(36,'装饰五金','',1,22,40,'','','','','','','list_product_diy.html','show_product.html',0,1,0,0,'','',0),(68,'更多分站','',1,0,37,'','','','','','','list_map.html','',0,1,0,0,'','',1),(73,'在线留言','',1,0,37,'','测试11在线留言SEO标题','测试22在线留言SEO关键词','测试33在线留言SEO描述','','','list_page_book.html','',0,1,0,0,'','',1),(83,'测试栏目','测试栏目',1,28,41,'/uploads/image/20170929/981f6de833848af6d8cb62f6d744e3af.jpg','','','','','','list_picture.html','show_product.html',0,1,0,1,'<p>测试栏目</p>','<p>测试栏目</p>',0),(86,'测试产品栏目','测试产品栏目',1,21,2,'20190314/af917a9586c1e8c1250223291fecfcc3.jpg','测试产品栏目','测试产品栏目','测试产品栏目',